from heapq import heappop, heappush
from typing import List


class Solution:
    def minimumObstacles(self, grid: List[List[int]]) -> int:
        n, m = len(grid), len(grid[0])

        # Priority queue: (cost, x, y)
        pq = [(0, 0, 0)]

        # Distance matrix: initialize to infinity
        distance = [[float('inf')] * m for _ in range(n)]
        distance[0][0] = 0  # Start with the top-left cell

        directions = [(-1, 0), (1, 0), (0, -1), (0, 1)]  # Up, down, left, right

        while pq:
            cost, x, y = heappop(pq)

            # If we've reached the bottom-right cell, return the cost
            if x == n - 1 and y == m - 1:
                return cost

            # Explore neighbors
            for dx, dy in directions:
                nx, ny = x + dx, y + dy

                if 0 <= nx < n and 0 <= ny < m:
                    new_cost = cost + grid[nx][ny]
                    # Update distance if a shorter path is found
                    if new_cost < distance[nx][ny]:
                        distance[nx][ny] = new_cost
                        heappush(pq, (new_cost, nx, ny))

        # If no path exists (theoretically shouldn't happen here), return -1
        return -1


